    "cownose-ray-comparative-morphology-and-distribution-data",nt"isopen": false,nt"url":
    null,nt"notes": "Morphometric and meristic data from two species of rays within
    the genus Rhinoptera were collected to facilitate accurate identifications of the
    two species. Data were compared, based on genetic verification of specimens, to
    determine if both species (i.e. R. bonasus and R. brasiliensis) are present in the
    northern Gulf of Mexico and off the east coast of the United States. Specimens were
    obtained from a number of sources, including NOAA surveys, fishing tournaments and
    museum collections. ",nt"license_title": null,nt"extras": [{ntt"key":
